    [],nt"num_tags": 0,nt"name": "dissolved-inorganic-carbon-temperature-salinity-and-other-variables-collected-from-discrete-sam36a8c",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0113550 includes chemical,
    discrete sample, physical and profile data collected from HUDSON in the Labrador
    Sea and North Atlantic Ocean from 1992-05-27 to 1992-06-15 and retrieved during
    cruise CARINA/18HU19920527. These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113
    (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), DISSOLVED
    INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE, Potential
    temperature (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments used
    to collect these data include CTD and bottle. These data were collected by E. Peter
    Jones of Bedford Institute of Oceanography and J. Lazier [affiliation unknown] as
    part of the CARINA/18HU19920527 data set.nnThe CARINA (CARbon dioxide IN the Atlantic
    Ocean) data synthesis project is an international collaborative effort of the EU
    IP CARBOOCEAN, and U.S. partners. It has produced a merged internally consistent
    data set of open ocean subsurface measurements for biogeochemical investigations,
    in particular, studies involving the carbon system. The original focus area was
    the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
